import React from "react";


const ContactsItem = ({contact})  => {
    console.log(contact)
    return (
        <div className="contact_card">
            <h1 className="name">{contact.name} <span className="type">{contact.type}</span></h1>
            <h2 className="email">{contact.email}</h2>
            <h2 className="phone">{contact.phone}</h2>
            <div>
                <button className="btn edit_btn">Edit</button>
                <button className="btn delete_btn">Delete</button>
            </div>
        </div>
    )    
}

export default ContactsItem;
